import './App.css';
import './css/header.css';


function showWindow(){
    let element = document.getElementById('content_window');
    if (element.style.display === 'none') {
        element.style.display = 'block';
    } else {
        element.style.display = 'none';
    }
}


export default function Header() {
  return (
    <div className="Header">
      <div class='Logo'>MONKEY SCRIPT</div>

      <ul id="yakors">
        <li><a href="#main2"  title="Link" >Примеры работ</a></li>
        <li><a href="#main3"  title="Link" >Тарифы</a></li>
        <li><a href="#main4"  title="Link" >Контакты</a></li>
      </ul>

      <ul id="regent">
        <li><a href="Enter.html" target="_blank" title="Link" className="btn">Вход</a></li>
        <li><div className="btn" onClick={showWindow()}>Регистрация</div></li>
      </ul>

    </div>
  );
}
